import React, { useState, useEffect } from 'react';
import { useReactTable, getCoreRowModel, createColumnHelper, flexRender } from '@tanstack/react-table';
import { api } from '../services/api';

interface CrosswalkGridProps {
  profileId: number;
  mappings: any[];
  loading: boolean;
  onMappingsUpdate: (mappings: any[]) => void;
  onRowSelect: (mapping: any) => void;
  selectedRow: any;
}

const CrosswalkGrid: React.FC<CrosswalkGridProps> = ({
  profileId,
  mappings,
  loading,
  onMappingsUpdate,
  onRowSelect,
  selectedRow
}) => {
  const [data, setData] = useState<any[]>([]);
  const [dataModelFields, setDataModelFields] = useState<any>({});
  const [filter, setFilter] = useState('');

  const columnHelper = createColumnHelper<any>();

  useEffect(() => {
    setData(mappings);
  }, [mappings]);

  useEffect(() => {
    fetchDataModelFields();
  }, []);

  const fetchDataModelFields = async () => {
    try {
      const fields = await api.get('/data-model-fields');
      setDataModelFields(fields);
    } catch (error) {
      console.error('Error fetching data model fields:', error);
    }
  };

  const updateMappingField = (rowIndex: number, field: string, value: any) => {
    const newData = [...data];
    newData[rowIndex] = { ...newData[rowIndex], [field]: value };

    // Clear custom field name if not custom
    if (field === 'is_custom_field' && !value) {
      newData[rowIndex].custom_field_name = '';
    }

    // Clear model fields if custom
    if (field === 'is_custom_field' && value) {
      newData[rowIndex].model_table = '';
      newData[rowIndex].model_column = '';
    }

    // Update model columns when table changes
    if (field === 'model_table') {
      newData[rowIndex].model_column = '';
    }

    setData(newData);
  };

  const handleSave = async () => {
    try {
      await onMappingsUpdate(data);
    } catch (error) {
      console.error('Error saving mappings:', error);
    }
  };

  const columns = [
    columnHelper.accessor('source_column', {
      header: 'Source Column',
      cell: ({ getValue, row }) => (
        <div className="flex items-center space-x-2">
          <span className="font-medium text-gray-900">{getValue()}</span>
          {row.original.inferred_type && (
            <span className={`px-1.5 py-0.5 text-xs rounded ${
              row.original.inferred_type === 'string' ? 'bg-blue-100 text-blue-800' :
              row.original.inferred_type === 'number' ? 'bg-green-100 text-green-800' :
              row.original.inferred_type === 'date' ? 'bg-purple-100 text-purple-800' :
              'bg-gray-100 text-gray-800'
            }`}>
              {row.original.inferred_type}
            </span>
          )}
        </div>
      ),
    }),

    columnHelper.accessor('model_table', {
      header: 'Model Table',
      cell: ({ getValue, row, table }) => (
        <select
          value={getValue() || ''}
          onChange={(e) => updateMappingField(row.index, 'model_table', e.target.value)}
          disabled={row.original.is_custom_field}
          className="w-full px-2 py-1 border border-gray-300 rounded text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 disabled:bg-gray-100"
        >
          <option value="">Select table...</option>
          {Object.keys(dataModelFields).map(table => (
            <option key={table} value={table}>{table}</option>
          ))}
        </select>
      ),
    }),

    columnHelper.accessor('model_column', {
      header: 'Model Column',
      cell: ({ getValue, row }) => (
        <select
          value={getValue() || ''}
          onChange={(e) => updateMappingField(row.index, 'model_column', e.target.value)}
          disabled={row.original.is_custom_field || !row.original.model_table}
          className="w-full px-2 py-1 border border-gray-300 rounded text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 disabled:bg-gray-100"
        >
          <option value="">Select column...</option>
          {row.original.model_table && dataModelFields[row.original.model_table]?.map((field: any) => (
            <option key={field.column} value={field.column}>
              {field.column}
              {field.required && <span className="text-red-500">*</span>}
            </option>
          ))}
        </select>
      ),
    }),

    columnHelper.accessor('is_custom_field', {
      header: 'Custom?',
      cell: ({ getValue, row }) => (
        <input
          type="checkbox"
          checked={getValue() || false}
          onChange={(e) => updateMappingField(row.index, 'is_custom_field', e.target.checked)}
          className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
        />
      ),
    }),

    columnHelper.accessor('custom_field_name', {
      header: 'Custom Field Name',
      cell: ({ getValue, row }) => (
        <input
          type="text"
          value={getValue() || ''}
          onChange={(e) => updateMappingField(row.index, 'custom_field_name', e.target.value)}
          disabled={!row.original.is_custom_field}
          placeholder="Custom field name"
          className="w-full px-2 py-1 border border-gray-300 rounded text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 disabled:bg-gray-100"
        />
      ),
    }),

    columnHelper.accessor('transform_expression', {
      header: 'Transform (DSL)',
      cell: ({ getValue, row }) => (
        <input
          type="text"
          value={getValue() || ''}
          onChange={(e) => updateMappingField(row.index, 'transform_expression', e.target.value)}
          placeholder="e.g., upper(col('SOURCE_COLUMN'))"
          className="w-full px-2 py-1 border border-gray-300 rounded text-sm focus:outline-none focus:ring-1 focus:ring-blue-500"
        />
      ),
    }),

    columnHelper.accessor('regex_rules', {
      header: 'Regex Rules',
      cell: ({ getValue, row }) => {
        const rules = getValue() || [];
        return (
          <div className="flex flex-wrap gap-1">
            {rules.map((rule: any, index: number) => (
              <span
                key={index}
                className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-yellow-100 text-yellow-800"
              >
                {rule.rule_name || 'Rule'}
              </span>
            ))}
            {rules.length === 0 && (
              <span className="text-xs text-gray-400">No rules</span>
            )}
          </div>
        );
      },
    }),

    columnHelper.accessor('is_mapped', {
      header: 'Mapped?',
      cell: ({ getValue, row }) => {
        const isMapped = row.original.model_column || row.original.custom_field_name;
        return (
          <div className="flex items-center">
            {isMapped ? (
              <span className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-green-100 text-green-800">
                <i className="fas fa-check mr-1"></i>
                Mapped
              </span>
            ) : (
              <span className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-gray-100 text-gray-800">
                <i className="fas fa-minus mr-1"></i>
                Unmapped
              </span>
            )}
          </div>
        );
      },
    }),
  ];

  const table = useReactTable({
    data: data.filter(row => 
      !filter || row.source_column.toLowerCase().includes(filter.toLowerCase())
    ),
    columns,
    getCoreRowModel: getCoreRowModel(),
  });

  if (loading) {
    return (
      <div className="flex-1 flex items-center justify-center">
        <div className="text-center">
          <i className="fas fa-spinner fa-spin text-gray-400 text-2xl mb-2"></i>
          <p className="text-gray-600">Loading crosswalk data...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="flex-1 flex flex-col">
      {/* Toolbar */}
      <div className="bg-white border-b border-gray-200 px-4 py-3">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-4">
            <div className="relative">
              <i className="fas fa-search absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400"></i>
              <input
                type="text"
                placeholder="Filter columns..."
                value={filter}
                onChange={(e) => setFilter(e.target.value)}
                className="pl-9 pr-4 py-2 border border-gray-300 rounded-md text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            <div className="text-sm text-gray-600">
              {data.length} columns
            </div>
          </div>

          <button
            onClick={handleSave}
            className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <i className="fas fa-save mr-2"></i>
            Save Mappings
          </button>
        </div>
      </div>

      {/* Grid */}
      <div className="flex-1 overflow-auto">
        {data.length === 0 ? (
          <div className="flex-1 flex items-center justify-center bg-gray-50">
            <div className="text-center">
              <i className="fas fa-table text-gray-400 text-3xl mb-3"></i>
              <h3 className="text-lg font-medium text-gray-900 mb-2">No Data Available</h3>
              <p className="text-gray-600 max-w-sm">
                Upload a file or paste a schema to start mapping your columns.
              </p>
            </div>
          </div>
        ) : (
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              {table.getHeaderGroups().map(headerGroup => (
                <tr key={headerGroup.id}>
                  {headerGroup.headers.map(header => (
                    <th
                      key={header.id}
                      className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
                    >
                      {header.isPlaceholder
                        ? null
                        : flexRender(header.column.columnDef.header, header.getContext())
                      }
                    </th>
                  ))}
                </tr>
              ))}
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {table.getRowModel().rows.map(row => (
                <tr
                  key={row.id}
                  onClick={() => onRowSelect(row.original)}
                  className={`hover:bg-gray-50 cursor-pointer ${
                    selectedRow?.source_column_id === row.original.source_column_id
                      ? 'bg-blue-50 border-l-4 border-blue-500'
                      : ''
                  }`}
                >
                  {row.getVisibleCells().map(cell => (
                    <td key={cell.id} className="px-4 py-3 whitespace-nowrap text-sm">
                      {flexRender(cell.column.columnDef.cell, cell.getContext())}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default CrosswalkGrid;

frontend/src/components/DetailPanel.tsx.content:
import React, { useState } from 'react';
import { Profile } from '../types';
import RegexTester from './RegexTester';
import { api } from '../services/api';

interface DetailPanelProps {
  profile: Profile;
  selectedColumn: any;
  validationSummary: any;
  onRefresh: () => void;
}

const DetailPanel: React.FC<DetailPanelProps> = ({
  profile,
  selectedColumn,
  validationSummary,
  onRefresh
}) => {
  const [activeTab, setActiveTab] = useState<'regex' | 'sample' | 'validation' | 'export'>('regex');
  const [sampleData, setSampleData] = useState<any[]>([]);
  const [loadingSample, setLoadingSample] = useState(false);
  const [sampleError, setSampleError] = useState<string | null>(null);

  const fetchWarehouseSample = async () => {
    setLoadingSample(true);
    setSampleError(null);

    try {
      const response = await api.post(`/profiles/${profile.id}/sample/fetch`);
      setSampleData(response.data || []);
    } catch (error: any) {
      setSampleError(error.response?.data?.detail || 'Failed to fetch sample data');
    } finally {
      setLoadingSample(false);
    }
  };

  const downloadExport = async (format: 'csv' | 'xlsx' | 'json' | 'sql') => {
    try {
      const response = await fetch(`http://localhost:8000/api/profiles/${profile.id}/export/${format}`, {
        method: 'GET',
      });

      if (!response.ok) {
        throw new Error('Export failed');
      }

      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.style.display = 'none';
      a.href = url;
      a.download = `crosswalk_${profile.id}.${format}`;
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
      document.body.removeChild(a);
    } catch (error) {
      console.error('Export error:', error);
    }
  };

  return (
    <div className="h-full flex flex-col">
      {/* Header */}
      <div className="p-4 border-b border-gray-200">
        <h3 className="text-lg font-medium text-gray-900">Details</h3>

        {/* Tab Navigation */}
        <div className="mt-4 flex space-x-1 border-b border-gray-200">
          {[
            { id: 'regex', label: 'Regex Tester', icon: 'fa-code' },
            { id: 'sample', label: 'Sample Data', icon: 'fa-database' },
            { id: 'validation', label: 'Validation', icon: 'fa-check-circle' },
            { id: 'export', label: 'Export', icon: 'fa-download' }
          ].map(tab => (
            <button
              key={tab.id}
              onClick={() => setActiveTab(tab.id as any)}
              className={`px-3 py-2 text-sm font-medium border-b-2 transition-colors ${
                activeTab === tab.id
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700'
              }`}
            >
              <i className={`fas ${tab.icon} mr-1`}></i>
              {tab.label}
            </button>
          ))}
        </div>
      </div>

      {/* Tab Content */}
      <div className="flex-1 overflow-y-auto">
        {activeTab === 'regex' && (
          <div className="p-4">
            {selectedColumn ? (
              <RegexTester
                sourceColumn={selectedColumn}
                onRuleChange={onRefresh}
              />
            ) : (
              <div className="text-center py-8">
                <i className="fas fa-mouse-pointer text-gray-400 text-2xl mb-2"></i>
                <p className="text-gray-600">Select a row to test regex patterns</p>
              </div>
            )}
          </div>
        )}

        {activeTab === 'sample' && (
          <div className="p-4">
            <div className="space-y-4">
              {/* Sample Values from File */}
              {selectedColumn?.sample_values && selectedColumn.sample_values.length > 0 && (
                <div>
                  <h4 className="text-sm font-medium text-gray-900 mb-2">
                    Sample Values (from file)
                  </h4>
                  <div className="bg-gray-50 rounded-md p-3 max-h-32 overflow-y-auto">
                    {selectedColumn.sample_values.map((value: string, index: number) => (
                      <div key={index} className="text-sm text-gray-700 py-1 border-b border-gray-200 last:border-b-0">
                        {value}
                      </div>
                    ))}
                  </div>
                </div>
              )}

              {/* Warehouse Sample */}
              <div>
                <div className="flex items-center justify-between mb-2">
                  <h4 className="text-sm font-medium text-gray-900">
                    Warehouse Sample
                  </h4>
                  <button
                    onClick={fetchWarehouseSample}
                    disabled={loadingSample}
                    className="inline-flex items-center px-3 py-1 border border-gray-300 text-xs font-medium rounded text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500 disabled:opacity-50"
                  >
                    {loadingSample ? (
                      <>
                        <i className="fas fa-spinner fa-spin mr-1"></i>
                        Loading...
                      </>
                    ) : (
                      <>
                        <i className="fas fa-download mr-1"></i>
                        Fetch Sample
                      </>
                    )}
                  </button>
                </div>

                {sampleError && (
                  <div className="bg-red-50 border border-red-200 rounded-md p-3 mb-3">
                    <div className="flex">
                      <i className="fas fa-exclamation-triangle text-red-400 mt-0.5 mr-2"></i>
                      <div>
                        <h5 className="text-sm font-medium text-red-800">Error</h5>
                        <p className="text-sm text-red-700 mt-1">{sampleError}</p>
                      </div>
                    </div>
                  </div>
                )}

                {sampleData.length > 0 && (
                  <div className="bg-gray-50 rounded-md p-3 max-h-64 overflow-auto">
                    <div className="text-xs text-gray-600 mb-2">
                      {sampleData.length} rows fetched
                    </div>
                    <div className="space-y-2">
                      {sampleData.slice(0, 10).map((row, index) => (
                        <div key={index} className="bg-white rounded p-2 text-sm">
                          <pre className="text-xs text-gray-700 whitespace-pre-wrap">
                            {JSON.stringify(row, null, 2)}
                          </pre>
                        </div>
                      ))}
                    </div>
                  </div>
                )}

                {sampleData.length === 0 && !sampleError && !loadingSample && (
                  <div className="text-center py-6 text-gray-500">
                    <i className="fas fa-database text-2xl mb-2"></i>
                    <p className="text-sm">No sample data available</p>
                    <p className="text-xs">Click "Fetch Sample" to retrieve data from warehouse</p>
                  </div>
                )}
              </div>
            </div>
          </div>
        )}

        {activeTab === 'validation' && (
          <div className="p-4">
            {validationSummary ? (
              <div className="space-y-4">
                <div className="grid grid-cols-2 gap-4">
                  <div className="bg-blue-50 rounded-lg p-3">
                    <div className="text-2xl font-bold text-blue-600">
                      {validationSummary.mapped_columns}
                    </div>
                    <div className="text-sm text-blue-800">Mapped Columns</div>
                  </div>

                  <div className="bg-orange-50 rounded-lg p-3">
                    <div className="text-2xl font-bold text-orange-600">
                      {validationSummary.unmapped_columns}
                    </div>
                    <div className="text-sm text-orange-800">Unmapped Columns</div>
                  </div>

                  <div className="bg-green-50 rounded-lg p-3">
                    <div className="text-2xl font-bold text-green-600">
                      {validationSummary.regex_pass_count}
                    </div>
                    <div className="text-sm text-green-800">Regex Passes</div>
                  </div>

                  <div className="bg-red-50 rounded-lg p-3">
                    <div className="text-2xl font-bold text-red-600">
                      {validationSummary.regex_fail_count}
                    </div>
                    <div className="text-sm text-red-800">Regex Failures</div>
                  </div>
                </div>

                <div className="bg-gray-50 rounded-lg p-4">
                  <h4 className="text-sm font-medium text-gray-900 mb-2">
                    Mapping Progress
                  </h4>
                  <div className="w-full bg-gray-200 rounded-full h-3">
                    <div 
                      className="bg-blue-600 h-3 rounded-full transition-all duration-300"
                      style={{ width: `${validationSummary.mapping_percentage}%` }}
                    ></div>
                  </div>
                  <div className="text-sm text-gray-600 mt-1">
                    {validationSummary.mapping_percentage}% complete
                  </div>
                </div>
              </div>
            ) : (
              <div className="text-center py-8">
                <i className="fas fa-chart-bar text-gray-400 text-2xl mb-2"></i>
                <p className="text-gray-600">No validation data available</p>
              </div>
            )}
          </div>
        )}

        {activeTab === 'export' && (
          <div className="p-4">
            <div className="space-y-4">
              <div>
                <h4 className="text-sm font-medium text-gray-900 mb-3">Export Formats</h4>
                <div className="space-y-2">
                  <button
                    onClick={() => downloadExport('csv')}
                    className="w-full flex items-center justify-between p-3 border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500"
                  >
                    <div className="flex items-center">
                      <i className="fas fa-file-csv text-green-600 mr-3"></i>
                      <div className="text-left">
                        <div className="text-sm font-medium text-gray-900">CSV Export</div>
                        <div className="text-xs text-gray-600">Crosswalk mapping table</div>
                      </div>
                    </div>
                    <i className="fas fa-download text-gray-400"></i>
                  </button>

                  <button
                    onClick={() => downloadExport('xlsx')}
                    className="w-full flex items-center justify-between p-3 border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500"
                  >
                    <div className="flex items-center">
                      <i className="fas fa-file-excel text-green-600 mr-3"></i>
                      <div className="text-left">
                        <div className="text-sm font-medium text-gray-900">Excel Export</div>
                        <div className="text-xs text-gray-600">Spreadsheet format</div>
                      </div>
                    </div>
                    <i className="fas fa-download text-gray-400"></i>
                  </button>

                  <button
                    onClick={() => downloadExport('json')}
                    className="w-full flex items-center justify-between p-3 border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500"
                  >
                    <div className="flex items-center">
                      <i className="fas fa-file-code text-blue-600 mr-3"></i>
                      <div className="text-left">
                        <div className="text-sm font-medium text-gray-900">JSON Config</div>
                        <div className="text-xs text-gray-600">Pipeline configuration</div>
                      </div>
                    </div>
                    <i className="fas fa-download text-gray-400"></i>
                  </button>

                  <button
                    onClick={() => downloadExport('sql')}
                    className="w-full flex items-center justify-between p-3 border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500"
                  >
                    <div className="flex items-center">
                      <i className="fas fa-database text-purple-600 mr-3"></i>
                      <div className="text-left">
                        <div className="text-sm font-medium text-gray-900">SQL Script</div>
                        <div className="text-xs text-gray-600">DDL/DML statements</div>
                      </div>
                    </div>
                    <i className="fas fa-download text-gray-400"></i>
                  </button>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default DetailPanel;

frontend/src/components/FileUpload.tsx.content:
import React, { useState, useRef } from 'react';
import { api } from '../services/api';

interface FileUploadProps {
  profileId: number;
}

const FileUpload: React.FC<FileUploadProps> = ({ profileId }) => {
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState<any>(null);
  const [error, setError] = useState<string | null>(null);
  const fileInputRef = useRef<HTMLInputElement>(null);

  const handleFileSelect = async (event: React.ChangeEvent<HTMLInputElement>) => {
    const file = event.target.files?.[0];
    if (!file) return;

    // Validate file type
    const validTypes = ['.csv', '.xlsx', '.xls'];
    const fileExtension = file.name.toLowerCase().substring(file.name.lastIndexOf('.'));

    if (!validTypes.includes(fileExtension)) {
      setError('Please select a CSV or Excel file (.csv, .xlsx, .xls)');
      return;
    }

    // Validate file size (max 10MB)
    if (file.size > 10 * 1024 * 1024) {
      setError('File size must be less than 10MB');
      return;
    }

    await uploadFile(file);
  };

  const uploadFile = async (file: File) => {
    setUploading(true);
    setError(null);
    setUploadResult(null);

    try {
      const formData = new FormData();
      formData.append('file', file);

      const response = await api.postFormData(`/profiles/${profileId}/source/ingest-file`, formData);

      setUploadResult({
        success: true,
        message: response.message,
        columns_count: response.columns_count,
        columns: response.columns
      });

      // Clear the file input
      if (fileInputRef.current) {
        fileInputRef.current.value = '';
      }

      // Trigger page refresh or emit event to parent
      setTimeout(() => {
        window.location.reload();
      }, 1000);

    } catch (error: any) {
      setError(error.response?.data?.detail || 'Failed to upload file');
    } finally {
      setUploading(false);
    }
  };

  const handleDragOver = (event: React.DragEvent) => {
    event.preventDefault();
    event.stopPropagation();
  };

  const handleDrop = (event: React.DragEvent) => {
    event.preventDefault();
    event.stopPropagation();

    const files = event.dataTransfer.files;
    if (files.length > 0) {
      const file = files[0];

      // Validate file type
      const validTypes = ['.csv', '.xlsx', '.xls'];
      const fileExtension = file.name.toLowerCase().substring(file.name.lastIndexOf('.'));

      if (!validTypes.includes(fileExtension)) {
        setError('Please select a CSV or Excel file (.csv, .xlsx, .xls)');
        return;
      }

      uploadFile(file);
    }
  };

  return (
    <div className="space-y-4">
      {/* Upload Area */}
      <div
        className={`border-2 border-dashed rounded-lg p-6 text-center transition-colors ${
          uploading 
            ? 'border-blue-300 bg-blue-50' 
            : 'border-gray-300 hover:border-gray-400 bg-gray-50'
        }`}
        onDragOver={handleDragOver}
        onDrop={handleDrop}
      >
        {uploading ? (
          <div className="space-y-2">
            <i className="fas fa-spinner fa-spin text-blue-600 text-2xl"></i>
            <p className="text-sm text-blue-600 font-medium">Uploading and processing file...</p>
          </div>
        ) : (
          <div className="space-y-3">
            <i className="fas fa-cloud-upload-alt text-gray-400 text-3xl"></i>
            <div>
              <p className="text-sm font-medium text-gray-900 mb-1">
                Drop your file here or click to browse
              </p>
              <p className="text-xs text-gray-600">
                Supports CSV, Excel (.xlsx, .xls) files up to 10MB
              </p>
            </div>

            <button
              onClick={() => fileInputRef.current?.click()}
              className="inline-flex items-center px-4 py-2 border border-gray-300 text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
            >
              <i className="fas fa-folder-open mr-2"></i>
              Choose File
            </button>
          </div>
        )}
      </div>

      {/* Hidden File Input */}
      <input
        ref={fileInputRef}
        type="file"
        accept=".csv,.xlsx,.xls"
        onChange={handleFileSelect}
        className="hidden"
      />

      {/* Success Message */}
      {uploadResult?.success && (
        <div className="bg-green-50 border border-green-200 rounded-md p-4">
          <div className="flex">
            <i className="fas fa-check-circle text-green-400 mt-0.5 mr-3"></i>
            <div>
              <h4 className="text-sm font-medium text-green-800">Upload Successful</h4>
              <div className="text-sm text-green-700 mt-1">
                <p>{uploadResult.message}</p>
                <p className="mt-1">
                  <span className="font-medium">{uploadResult.columns_count}</span> columns detected
                </p>
              </div>

              {uploadResult.columns && uploadResult.columns.length > 0 && (
                <div className="mt-3">
                  <p className="text-sm font-medium text-green-800 mb-2">Detected columns:</p>
                  <div className="flex flex-wrap gap-1">
                    {uploadResult.columns.slice(0, 8).map((column: string, index: number) => (
                      <span
                        key={index}
                        className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-green-100 text-green-800"
                      >
                        {column}
                      </span>
                    ))}
                    {uploadResult.columns.length > 8 && (
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-gray-100 text-gray-600">
                        +{uploadResult.columns.length - 8} more
                      </span>
                    )}
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      )}

      {/* Error Message */}
      {error && (
        <div className="bg-red-50 border border-red-200 rounded-md p-4">
          <div className="flex">
            <i className="fas fa-exclamation-triangle text-red-400 mt-0.5 mr-3"></i>
            <div>
              <h4 className="text-sm font-medium text-red-800">Upload Failed</h4>
              <p className="text-sm text-red-700 mt-1">{error}</p>
            </div>
          </div>
        </div>
      )}

      {/* File Format Info */}
      <div className="bg-blue-50 border border-blue-200 rounded-md p-3">
        <div className="flex">
          <i className="fas fa-info-circle text-blue-400 mt-0.5 mr-2"></i>
          <div className="text-sm">
            <p className="font-medium text-blue-800 mb-1">Supported Formats</p>
            <ul className="text-blue-700 space-y-1">
              <li>â€¢ CSV files with comma, semicolon, or tab delimiters</li>
              <li>â€¢ Excel files (.xlsx, .xls) - first sheet will be used</li>
              <li>â€¢ First row should contain column headers</li>
              <li>â€¢ Maximum file size: 10MB</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FileUpload;

