import React, { useState } from 'react';
import { Profile } from '../types';
import FileUpload from './FileUpload';
import SchemaInput from './SchemaInput';

interface ProjectSidebarProps {
  profiles: Profile[];
  selectedProfile: Profile | null;
  onProfileSelect: (profile: Profile) => void;
  onCreateProfile: (name: string, clientId: string) => Promise<void>;
  loading: boolean;
}

const ProjectSidebar: React.FC<ProjectSidebarProps> = ({
  profiles,
  selectedProfile,
  onProfileSelect,
  onCreateProfile,
  loading
}) => {
  const [showCreateForm, setShowCreateForm] = useState(false);
  const [newProfileName, setNewProfileName] = useState('');
  const [newClientId, setNewClientId] = useState('');
  const [activeTab, setActiveTab] = useState<'file' | 'schema'>('file');

  const handleCreateProfile = async (e: React.FormEvent) => {
    e.preventDefault();
    if (newProfileName.trim()) {
      await onCreateProfile(newProfileName.trim(), newClientId.trim());
      setNewProfileName('');
      setNewClientId('');
      setShowCreateForm(false);
    }
  };

  return (
    <div className="h-full flex flex-col">
      {/* Header */}
      <div className="p-4 border-b border-gray-200">
        <div className="flex items-center justify-between mb-4">
          <h2 className="text-lg font-semibold text-gray-900">Projects</h2>
          <button
            onClick={() => setShowCreateForm(!showCreateForm)}
            className="inline-flex items-center px-3 py-1.5 border border-transparent text-xs font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <i className="fas fa-plus mr-1"></i>
            New
          </button>
        </div>

        {/* Create Project Form */}
        {showCreateForm && (
          <form onSubmit={handleCreateProfile} className="space-y-3 mb-4 p-3 bg-gray-50 rounded-md">
            <div>
              <label className="block text-xs font-medium text-gray-700 mb-1">
                Project Name *
              </label>
              <input
                type="text"
                value={newProfileName}
                onChange={(e) => setNewProfileName(e.target.value)}
                className="w-full px-2 py-1 border border-gray-300 rounded-sm text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
                placeholder="Enter project name"
                required
              />
            </div>
            <div>
              <label className="block text-xs font-medium text-gray-700 mb-1">
                Client ID
              </label>
              <input
                type="text"
                value={newClientId}
                onChange={(e) => setNewClientId(e.target.value)}
                className="w-full px-2 py-1 border border-gray-300 rounded-sm text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
                placeholder="e.g., CCA"
              />
            </div>
            <div className="flex space-x-2">
              <button
                type="submit"
                className="flex-1 px-3 py-1.5 text-xs font-medium text-white bg-blue-600 rounded-sm hover:bg-blue-700 focus:outline-none focus:ring-1 focus:ring-blue-500"
              >
                Create
              </button>
              <button
                type="button"
                onClick={() => setShowCreateForm(false)}
                className="flex-1 px-3 py-1.5 text-xs font-medium text-gray-700 bg-white border border-gray-300 rounded-sm hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500"
              >
                Cancel
              </button>
            </div>
          </form>
        )}
      </div>

      {/* Projects List */}
      <div className="flex-1 overflow-y-auto">
        {loading ? (
          <div className="p-4 text-center">
            <i className="fas fa-spinner fa-spin text-gray-400"></i>
            <p className="text-sm text-gray-600 mt-2">Loading projects...</p>
          </div>
        ) : profiles.length === 0 ? (
          <div className="p-4 text-center">
            <i className="fas fa-folder-open text-gray-400 text-2xl mb-2"></i>
            <p className="text-sm text-gray-600">No projects yet</p>
            <p className="text-xs text-gray-500 mt-1">Create your first project above</p>
          </div>
        ) : (
          <div className="space-y-1 p-2">
            {profiles.map((profile) => (
              <button
                key={profile.id}
                onClick={() => onProfileSelect(profile)}
                className={`w-full text-left p-3 rounded-md text-sm transition-colors ${
                  selectedProfile?.id === profile.id
                    ? 'bg-blue-50 border border-blue-200 text-blue-900'
                    : 'hover:bg-gray-50 border border-transparent'
                }`}
              >
                <div className="font-medium text-gray-900">{profile.name}</div>
                {profile.client_id && (
                  <div className="text-xs text-gray-600 mt-1">
                    Client: {profile.client_id}
                  </div>
                )}
                <div className="flex items-center text-xs text-gray-500 mt-1">
                  <i className={`fas ${profile.has_physical_file ? 'fa-file' : 'fa-list'} mr-1`}></i>
                  {profile.has_physical_file ? 'File uploaded' : 'Schema only'}
                </div>
              </button>
            ))}
          </div>
        )}
      </div>

      {/* Data Input Section */}
      {selectedProfile && (
        <div className="border-t border-gray-200 p-4">
          <h3 className="text-sm font-medium text-gray-900 mb-3">Data Input</h3>

          {/* Tab Navigation */}
          <div className="flex border-b border-gray-200 mb-3">
            <button
              onClick={() => setActiveTab('file')}
              className={`flex-1 py-2 px-1 text-xs font-medium border-b-2 transition-colors ${
                activeTab === 'file'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700'
              }`}
            >
              <i className="fas fa-upload mr-1"></i>
              Upload File
            </button>
            <button
              onClick={() => setActiveTab('schema')}
              className={`flex-1 py-2 px-1 text-xs font-medium border-b-2 transition-colors ${
                activeTab === 'schema'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700'
              }`}
            >
              <i className="fas fa-list mr-1"></i>
              Schema
            </button>
          </div>

          {/* Tab Content */}
          {activeTab === 'file' ? (
            <FileUpload profileId={selectedProfile.id} />
          ) : (
            <SchemaInput profileId={selectedProfile.id} />
          )}
        </div>
      )}
    </div>
  );
};

export default ProjectSidebar;

frontend/src/components/RegexTester.tsx.content:
import React, { useState } from 'react';
import { api } from '../services/api';

interface RegexTesterProps {
  sourceColumn: any;
  onRuleChange: () => void;
}

const RegexTester: React.FC<RegexTesterProps> = ({ sourceColumn, onRuleChange }) => {
  const [newRule, setNewRule] = useState({
    rule_name: '',
    pattern: '',
    flags: '',
    description: ''
  });
  const [testValue, setTestValue] = useState('');
  const [testResult, setTestResult] = useState<any>(null);
  const [testing, setTesting] = useState(false);

  const handleCreateRule = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!newRule.pattern.trim()) return;

    try {
      await api.post(`/source-columns/${sourceColumn.source_column_id}/regex`, newRule);
      setNewRule({ rule_name: '', pattern: '', flags: '', description: '' });
      onRuleChange();
    } catch (error: any) {
      alert(error.response?.data?.detail || 'Error creating regex rule');
    }
  };

  const handleDeleteRule = async (ruleId: number) => {
    try {
      await api.delete(`/regex-rules/${ruleId}`);
      onRuleChange();
    } catch (error: any) {
      alert(error.response?.data?.detail || 'Error deleting regex rule');
    }
  };

  const handleTestRegex = async () => {
    if (!newRule.pattern.trim() || !testValue.trim()) return;

    setTesting(true);
    try {
      const params = new URLSearchParams({
        pattern: newRule.pattern,
        value: testValue,
        flags: newRule.flags
      });

      const result = await api.get(`/source-columns/${sourceColumn.source_column_id}/regex/test?${params}`);
      setTestResult(result);
    } catch (error: any) {
      setTestResult({ error: error.response?.data?.detail || 'Test failed' });
    } finally {
      setTesting(false);
    }
  };

  const testRuleAgainstSamples = async (rule: any) => {
    const sampleValues = sourceColumn.sample_values || [];
    if (sampleValues.length === 0) return null;

    try {
      const results = await Promise.all(
        sampleValues.slice(0, 5).map(async (value: string) => {
          const params = new URLSearchParams({
            pattern: rule.pattern,
            value,
            flags: rule.flags || ''
          });

          const result = await api.get(`/source-columns/${sourceColumn.source_column_id}/regex/test?${params}`);
          return { value, matches: result.matches };
        })
      );

      return results;
    } catch (error) {
      return null;
    }
  };

  return (
    <div className="space-y-6">
      {/* Existing Rules */}
      <div>
        <h4 className="text-sm font-medium text-gray-900 mb-3">
          Existing Rules for "{sourceColumn.source_column}"
        </h4>

        {sourceColumn.regex_rules && sourceColumn.regex_rules.length > 0 ? (
          <div className="space-y-2">
            {sourceColumn.regex_rules.map((rule: any) => (
              <div key={rule.id} className="bg-gray-50 rounded-md p-3">
                <div className="flex items-start justify-between">
                  <div className="flex-1">
                    <div className="flex items-center space-x-2 mb-1">
                      <span className="font-medium text-sm text-gray-900">
                        {rule.rule_name || 'Unnamed Rule'}
                      </span>
                      {rule.flags && (
                        <span className="px-1.5 py-0.5 text-xs bg-blue-100 text-blue-800 rounded">
                          {rule.flags}
                        </span>
                      )}
                    </div>
                    <div className="text-sm text-gray-700 font-mono bg-white rounded px-2 py-1 mb-1">
                      {rule.pattern}
                    </div>
                    {rule.description && (
                      <div className="text-xs text-gray-600">{rule.description}</div>
                    )}
                  </div>
                  <button
                    onClick={() => handleDeleteRule(rule.id)}
                    className="ml-2 text-red-600 hover:text-red-800 focus:outline-none"
                  >
                    <i className="fas fa-trash text-sm"></i>
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="text-center py-4 text-gray-500 bg-gray-50 rounded-md">
            <i className="fas fa-code text-xl mb-1"></i>
            <p className="text-sm">No regex rules defined</p>
          </div>
        )}
      </div>

      {/* Create New Rule */}
      <div>
        <h4 className="text-sm font-medium text-gray-900 mb-3">Create New Rule</h4>

        <form onSubmit={handleCreateRule} className="space-y-3">
          <div>
            <label className="block text-xs font-medium text-gray-700 mb-1">
              Rule Name
            </label>
            <input
              type="text"
              value={newRule.rule_name}
              onChange={(e) => setNewRule({ ...newRule, rule_name: e.target.value })}
              className="w-full px-3 py-2 border border-gray-300 rounded-md text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
              placeholder="e.g., digits_only"
            />
          </div>

          <div>
            <label className="block text-xs font-medium text-gray-700 mb-1">
              Regex Pattern *
            </label>
            <input
              type="text"
              value={newRule.pattern}
              onChange={(e) => setNewRule({ ...newRule, pattern: e.target.value })}
              className="w-full px-3 py-2 border border-gray-300 rounded-md text-sm font-mono focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
              placeholder="e.g., ^[0-9]+$"
              required
            />
          </div>

          <div>
            <label className="block text-xs font-medium text-gray-700 mb-1">
              Flags
            </label>
            <input
              type="text"
              value={newRule.flags}
              onChange={(e) => setNewRule({ ...newRule, flags: e.target.value })}
              className="w-full px-3 py-2 border border-gray-300 rounded-md text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
              placeholder="e.g., i,m"
            />
            <div className="text-xs text-gray-500 mt-1">
              Common flags: i (case insensitive), m (multiline), s (dotall)
            </div>
          </div>

          <div>
            <label className="block text-xs font-medium text-gray-700 mb-1">
              Description
            </label>
            <textarea
              value={newRule.description}
              onChange={(e) => setNewRule({ ...newRule, description: e.target.value })}
              rows={2}
              className="w-full px-3 py-2 border border-gray-300 rounded-md text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
              placeholder="Describe what this pattern validates..."
            />
          </div>

          <button
            type="submit"
            className="w-full inline-flex items-center justify-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <i className="fas fa-plus mr-2"></i>
            Add Rule
          </button>
        </form>
      </div>

      {/* Test Pattern */}
      <div>
        <h4 className="text-sm font-medium text-gray-900 mb-3">Test Pattern</h4>

        <div className="space-y-3">
          <div>
            <label className="block text-xs font-medium text-gray-700 mb-1">
              Test Value
            </label>
            <div className="flex space-x-2">
              <input
                type="text"
                value={testValue}
                onChange={(e) => setTestValue(e.target.value)}
                className="flex-1 px-3 py-2 border border-gray-300 rounded-md text-sm focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
                placeholder="Enter value to test"
              />
              <button
                onClick={handleTestRegex}
                disabled={testing || !newRule.pattern.trim() || !testValue.trim()}
                className="px-4 py-2 border border-gray-300 text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-1 focus:ring-blue-500 disabled:opacity-50"
              >
                {testing ? (
                  <i className="fas fa-spinner fa-spin"></i>
                ) : (
                  <i className="fas fa-play"></i>
                )}
              </button>
            </div>
          </div>

          {/* Quick Test with Sample Values */}
          {sourceColumn.sample_values && sourceColumn.sample_values.length > 0 && (
            <div>
              <label className="block text-xs font-medium text-gray-700 mb-1">
                Quick Test (sample values)
              </label>
              <div className="space-y-1">
                {sourceColumn.sample_values.slice(0, 3).map((value: string, index: number) => (
                  <button
                    key={index}
                    onClick={() => setTestValue(value)}
                    className="w-full text-left px-2 py-1 text-sm bg-gray-50 hover:bg-gray-100 rounded border text-gray-700"
                  >
                    {value}
                  </button>
                ))}
              </div>
            </div>
          )}

          {/* Test Result */}
          {testResult && (
            <div className="border rounded-md p-3">
              {testResult.error ? (
                <div className="text-red-600">
                  <i className="fas fa-exclamation-triangle mr-1"></i>
                  Error: {testResult.error}
                </div>
              ) : (
                <div>
                  <div className={`flex items-center mb-2 ${
                    testResult.matches ? 'text-green-600' : 'text-red-600'
                  }`}>
                    <i className={`fas ${testResult.matches ? 'fa-check-circle' : 'fa-times-circle'} mr-2`}></i>
                    <span className="font-medium">
                      {testResult.matches ? 'Match Found' : 'No Match'}
                    </span>
                  </div>

                  {testResult.matches && (
                    <div className="space-y-1">
                      {testResult.full_match && (
                        <div className="text-sm">
                          <span className="text-gray-600">Full match:</span>
                          <span className="ml-2 font-mono bg-yellow-100 px-1 rounded">
                            {testResult.full_match}
                          </span>
                        </div>
                      )}

                      {testResult.groups && testResult.groups.length > 0 && (
                        <div className="text-sm">
                          <span className="text-gray-600">Groups:</span>
                          <div className="ml-2 space-y-1">
                            {testResult.groups.map((group: string, index: number) => (
                              <div key={index} className="font-mono bg-blue-100 px-1 rounded inline-block mr-1">
                                {index + 1}: {group}
                              </div>
                            ))}
                          </div>
                        </div>
                      )}
                    </div>
                  )}
                </div>
              )}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default RegexTester;

frontend/src/components/SchemaInput.tsx.content:
import React, { useState } from 'react';
import { api } from '../services/api';

interface SchemaInputProps {
  profileId: number;
}

const SchemaInput: React.FC<SchemaInputProps> = ({ profileId }) => {
  const [schemaText, setSchemaText] = useState('');
  const [submitting, setSubmitting] = useState(false);
  const [result, setResult] = useState<any>(null);
  const [error, setError] = useState<string | null>(null);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!schemaText.trim()) {
      setError('Please enter column names');
      return;
    }

    setSubmitting(true);
    setError(null);
    setResult(null);

    try {
      // Parse column names from text (one per line)
      const columns = schemaText
        .split('\n')
        .map(line => line.trim())
        .filter(line => line.length > 0);

      if (columns.length === 0) {
        throw new Error('No valid column names found');
      }

      const response = await api.post(`/profiles/${profileId}/source/ingest-schema`, {
        columns: columns
      });

      setResult({
        success: true,
        message: response.message,
        columns_count: response.columns_count,
        columns: response.columns
      });

      // Clear the input after successful submission
      setSchemaText('');

      // Trigger page refresh or emit event to parent
      setTimeout(() => {
        window.location.reload();
      }, 1000);

    } catch (error: any) {
      setError(error.response?.data?.detail || error.message || 'Failed to process schema');
    } finally {
      setSubmitting(false);
    }
  };

  const handleLoadExample = () => {
    const exampleSchema = `PATIENT_ID
CLAIMTYPE
SVC_DT
CHARGE
NPI_NUM
DR_NAME
PLAN_CODE`;
    setSchemaText(exampleSchema);
  };

  const handleClear = () => {
    setSchemaText('');
    setResult(null);
    setError(null);
  };

  return (
    <div className="space-y-4">
      <form onSubmit={handleSubmit} className="space-y-4">
        {/* Schema Input */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Column Names
            <span className="text-xs text-gray-500 ml-1">(one per line)</span>
          </label>
          <textarea
            value={schemaText}
            onChange={(e) => setSchemaText(e.target.value)}
            rows={8}
            className="w-full px-3 py-2 border border-gray-300 rounded-md text-sm font-mono focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500"
            placeholder="Enter column names, one per line:&#10;&#10;PATIENT_ID&#10;CLAIM_TYPE&#10;SERVICE_DATE&#10;AMOUNT"
          />

          <div className="flex justify-between items-center mt-2">
            <div className="text-xs text-gray-500">
              {schemaText.split('\n').filter(line => line.trim()).length} columns
            </div>

            <div className="space-x-2">
              <button
                type="button"
                onClick={handleLoadExample}
                className="text-xs text-blue-600 hover:text-blue-800 underline"
              >
                Load Example
              </button>

              <button
                type="button"
                onClick={handleClear}
                className="text-xs text-gray-600 hover:text-gray-800 underline"
              >
                Clear
              </button>
            </div>
          </div>
        </div>

        {/* Submit Button */}
        <button
          type="submit"
          disabled={submitting || !schemaText.trim()}
          className="w-full inline-flex items-center justify-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50 disabled:cursor-not-allowed"
        >
          {submitting ? (
            <>
              <i className="fas fa-spinner fa-spin mr-2"></i>
              Processing Schema...
            </>
          ) : (
            <>
              <i className="fas fa-check mr-2"></i>
              Import Schema
            </>
          )}
        </button>
      </form>

      {/* Success Message */}
      {result?.success && (
        <div className="bg-green-50 border border-green-200 rounded-md p-4">
          <div className="flex">
            <i className="fas fa-check-circle text-green-400 mt-0.5 mr-3"></i>
            <div>
              <h4 className="text-sm font-medium text-green-800">Schema Imported</h4>
              <div className="text-sm text-green-700 mt-1">
                <p>{result.message}</p>
                <p className="mt-1">
                  <span className="font-medium">{result.columns_count}</span> columns imported
                </p>
              </div>

              {result.columns && result.columns.length > 0 && (
                <div className="mt-3">
                  <p className="text-sm font-medium text-green-800 mb-2">Imported columns:</p>
                  <div className="flex flex-wrap gap-1">
                    {result.columns.slice(0, 8).map((column: string, index: number) => (
                      <span
                        key={index}
                        className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-green-100 text-green-800"
                      >
                        {column}
                      </span>
                    ))}
                    {result.columns.length > 8 && (
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs bg-gray-100 text-gray-600">
                        +{result.columns.length - 8} more
                      </span>
                    )}
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      )}

      {/* Error Message */}
      {error && (
        <div className="bg-red-50 border border-red-200 rounded-md p-4">
          <div className="flex">
            <i className="fas fa-exclamation-triangle text-red-400 mt-0.5 mr-3"></i>
            <div>
              <h4 className="text-sm font-medium text-red-800">Import Failed</h4>
              <p className="text-sm text-red-700 mt-1">{error}</p>
            </div>
          </div>
        </div>
      )}

      {/* Instructions */}
      <div className="bg-blue-50 border border-blue-200 rounded-md p-3">
        <div className="flex">
          <i className="fas fa-info-circle text-blue-400 mt-0.5 mr-2"></i>
          <div className="text-sm">
            <p className="font-medium text-blue-800 mb-1">Schema-Only Mode</p>
            <ul className="text-blue-700 space-y-1">
              <li>â€¢ Enter column names one per line</li>
              <li>â€¢ No sample data will be available until you upload a file</li>
              <li>â€¢ You can still create mappings and regex rules</li>
              <li>â€¢ Useful when you know the schema but don't have the file yet</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

