        {/* Skipped Flag */}
        <div className="flex items-center">
          <input
            type="checkbox"
            id="skipped"
            checked={formData.skipped_flag || false}
            onChange={(e) => setFormData({ ...formData, skipped_flag: e.target.checked })}
