        <button
          onClick={handleSave}
          className="flex-1 px-4 py-2 bg-orange-600 text-white rounded-md hover:bg-orange-700 focus:outline-none focus:ring-2 focus:ring-orange-500"
        >
          Save Changes
        </button>
      </div>
    </div>
  );
};

